import { NavLink } from "react-router-dom";
import { useEffect, useState } from "react";
import { OurNewsLetter } from "./OurNewsLetter";


export const Home = () => {

    let [picUrl, setPicUrl] = useState('')
    let [i, setI] = useState(0)

    useEffect(() => {

        let urls = ['a1', 'a2', 'a3', 'a4']

        setPicUrl(urls[0])

        let interval = setInterval(() => {
            setI(prevI => {
                const newI = (prevI + 1) % urls.length
                setPicUrl(urls[newI])
                return newI
            })
        }, 5000);

        const observer = new IntersectionObserver((entries) => {
            entries.forEach(entry => {
                if (entry.isIntersecting) {
                    entry.target.classList.add('homePicturesAnimations');
                } else {
                    entry.target.classList.remove('homePicturesAnimations');
                }
            });
        });

        document.querySelectorAll('.observe').forEach(element => {
            observer.observe(element);
        });


        return () => { clearInterval(interval) }
    }, []);

    return <div className="home">
        <nav className="homeNav">
            <img className="logo" src={`${process.env.PUBLIC_URL}/images/apartments/logo.gif`}></img>
            <div className="links">
                <NavLink className="niceLink">לצפייה בקטלוג הדירות</NavLink>
                <NavLink className="niceLink">לאזור אישי</NavLink>
            </div>
        </nav>
        <div className="home1">
            <div className="mainTitle">
                <h1>vacation holyday</h1>
                <h3>דירות נופש בטעם שלך</h3>
            </div>

            <img className="img" src={`${process.env.PUBLIC_URL}/images/apartments/homePictures/${picUrl}.png`}></img>

            <div className="homePicturesDiv">
                <img className="homePictures" class="observe" src={`${process.env.PUBLIC_URL}/images/apartments/homePictures/home4.jpg`}></img>
                <img className="homePictures" src={`${process.env.PUBLIC_URL}/images/apartments/homePictures/home2.jpg`}></img>
                <img className="homePictures" src={`${process.env.PUBLIC_URL}/images/apartments/homePictures/home1.jpg`}></img>
                <img className="homePictures" src={`${process.env.PUBLIC_URL}/images/apartments/homePictures/home3.jpg`}></img>
            </div>

            <NavLink className="niceLinkFooter">{"רוצים לראות עוד? כנסו->"}</NavLink>

            <div className="homePicturesDiv">
                <img className="homePictures"  class="observe" src={`${process.env.PUBLIC_URL}/images/apartments/homePictures/home4.jpg`}></img>
                <img className="homePictures" class="observe" src={`${process.env.PUBLIC_URL}/images/apartments/homePictures/home2.jpg`}></img>
                <img className="homePictures" class="observe" src={`${process.env.PUBLIC_URL}/images/apartments/homePictures/home1.jpg`}></img>
                <img className="homePictures" class="observe" src={`${process.env.PUBLIC_URL}/images/apartments/homePictures/home3.jpg`}></img>
            </div>
            <NavLink className="niceLinkFooter" id="advisterLink">{"יש לכם דירת נופש? מוזמנים לפרסם אצלנו ולהנות מקהל לקוחות רחב"}</NavLink>
            <div className="homePicturesDiv">
                <img className="homePictures" class="observe" src={`${process.env.PUBLIC_URL}/images/apartments/homePictures/home4.jpg`}></img>
                <img className="homePictures" class="observe" src={`${process.env.PUBLIC_URL}/images/apartments/homePictures/home2.jpg`}></img>
                <img className="homePictures" src={`${process.env.PUBLIC_URL}/images/apartments/homePictures/home1.jpg`}></img>
                <img className="homePictures" src={`${process.env.PUBLIC_URL}/images/apartments/homePictures/home3.jpg`}></img>
            </div>

            <div className="footerDiv">
                <img className="img" src={`${process.env.PUBLIC_URL}/images/apartments/niceFooter.png`}></img>
                <div className="overPart">
                    <p className="overText">
                        פה יהיה כתוב כל מיני דברים בשבח האתר שלנו
                        כמה שהוא יפה, מושלם ומהמם
                        ועוד ועוד כל מיני דברים מעניינים (או שכן או שלא)
                        נראה אח"כ מה לכתוב פה
                        פה יהיה כתוב כל מיני דברים בשבח האתר שלנו
                        כמה שהוא יפה, מושלם ומהמם
                        ועוד ועוד כל מיני דברים מעניינים (או שכן או שלא)
                        נראה אח"כ מה לכתוב פה
                        פה יהיה כתוב כל מיני דברים בשבח האתר שלנו
                        כמה שהוא יפה, מושלם ומהמם
                        ועוד ועוד כל מיני דברים מעניינים (או שכן או שלא)
                        נראה אח"כ מה לכתוב פה
                    </p>
                    <OurNewsLetter></OurNewsLetter>
                </div>
            </div>
        </div>
    </div>
}
